const DUMMY_EVENTS = [
    {
        id: 'e1',
        title: 'Event 1'
    },
    {
        id: 'e2',
        title: 'Event 2'
    },
]


export default function EventsPage() {
    return<>
       <ul>
      {DUMMY_EVENTS.map(event => {
        return <li key={event.id}>{event.title}</li>
      })}
       </ul>
    </>
}
